const Header = () => {
  return (
    <header className="header">
      <h1>Barış Can Demirel</h1>
      <p>Yazılım Mühendisi</p>
      <div className="social-links">
        <a href="mailto:bariscandemirel35@gmail.com">
          <i className="fas fa-envelope"></i> E-posta
        </a>
        <a href="tel:+905437704490">
          <i className="fas fa-phone"></i> Telefon
        </a>
        <a href="#">
          <i className="fas fa-map-marker-alt"></i> İzmir
        </a>
        <a href="/BarisCanDemirel_CV.pdf" download>
          <i className="fas fa-download"></i> CV İndir
        </a>
      </div>
    </header>
  );
};

export default Header;
